script: |
  super -f tsv -I q753.sql | sort > q753.out

vector: true

inputs:
  - name: q753.sql
    data: |
      SELECT d-e,
      a,
      b-c,
      e,
      d
      FROM t1
      WHERE e+d BETWEEN a+b-10 AND c+130;
  - name: t1

outputs:
  - name: q753.out
    data: |
      -1	107	-1	109	108
      2	127	4	126	128
